CREATE TABLE IF NOT EXISTS "ACCOUNT_BALANCE" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "ACCOUNT_ID" numeric(20) NOT NULL,
  "DATUM" date NOT NULL,
  "BALANCE" decimal(50,2) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "ACCOUNTS" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "DESCRIPTION" varchar(200) NOT NULL,
  "NUMBER" varchar(50) NOT NULL,
  "NAME" varchar(200) NOT NULL,
  "DATE_OPENED" date NOT NULL,
  "DATE_CLOSED" date,
  "TYPE" integer NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "ACTIVA" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "BALANS_ID" numeric(20) NOT NULL,
  "KOST_ID" numeric(20) NOT NULL,
  "NOFYEARSFORDEPRECIATION" integer NOT NULL,
  "STARTDATE" date,
  "EINDDATUM" date,
  "REMAININGVALUE" decimal(50,0),
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "BALANS" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "BALANSSOORT_ID" numeric(20) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "BALANSSOORT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "OMSCHRIJVING" varchar(40) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "BOEKWAARDE" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "BALANS_ID" numeric(20),
  "BOEKJAAR" integer NOT NULL,
  "SALDO" decimal(50,0) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "BTWMATCH" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "KOSTMATCH_ID" numeric(20) NOT NULL,
  "BTW_TYPE" char(1),
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "BTWMATCH_PRIVATE" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "KOSTMATCH_ID" numeric(20) NOT NULL,
  "BTW_TYPE" char(1),
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "CALENDAR_EVENT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "BEGINDATE" datetime NOT NULL,
  "ENDDATE" datetime NOT NULL,
  "HEADERCOLOR" varchar(7),
  "CONTENTCOLOR" varchar(7),
  "TITLE" varchar(200),
  "CONTENT" varchar(100),
  "PROJECT_ID" numeric(20),
  "UNITSOFWORK" float,
  "ISBILLABLE" integer NOT NULL,
  "TRAVELINGBYCARCOSTDECLARATION" decimal(50,2),
  "OTHERCOSTDECLARATION" decimal(50,2),
  "VATTYPEFOROTHERCOSTDECLARATION" char(1) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "COST_TYPE_EXPORT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "COST_TYPE_ID" numeric(20) NOT NULL,
  "EXTERNAL_CODE" varchar(16) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "COST_TYPE_IMPORT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "COST_ID" numeric(20) NOT NULL,
  "EXTERNAL_CODE" varchar(16) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "CUSTOMER" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "NAME" varchar(200),
  "DESCRIPTION" varchar(200),
  "COMMERCENR" decimal(65,0),
  "ADDRESS" varchar(200),
  "NUMBER" decimal(60,0),
  "NUMBER_EXTENSION" varchar(60),
  "POSTAL_CODE" varchar(60),
  "CITY" varchar(100),
  "CONTACT" varchar(200),
  "EMAIL_INVOICE" varchar(200),
  "TELEPHONE" varchar(60),
  "FAX" varchar(60),
  "WEBSITE" varchar(200),
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "EXTERNAL_COST_TYPES" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "CODE" varchar(16) NOT NULL,
  "DESCRIPTION" varchar(200) NOT NULL,
  "LEVEL" integer,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "KOSTEN" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "BEDRAG" decimal(50,2) NOT NULL,
  "DATUM" date NOT NULL,
  "OMSCHRIJVING" varchar(400) NOT NULL,
  "BTW" decimal(48,2) NOT NULL,
  "KOSTENSOORT_ID" numeric(20) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "KOSTENSOORT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "OMSCHRIJVING" varchar(100) NOT NULL,
  "BIJSCHRIJVING" integer NOT NULL,
  "BTWVERREKENBAAR" integer NOT NULL,
  "BALANSMEETELLEN" integer NOT NULL,
  "AFTREKBAAR" integer NOT NULL,
  "INVESTERING" integer,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "KOSTMATCH" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "KOSTENSOORT_ID" numeric(20) NOT NULL,
  "MATCH_TEXT" varchar(100) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "KOSTMATCH_PRIVATE" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "KOSTENSOORT_ID" numeric(20) NOT NULL,
  "MATCH_TEXT" varchar(200) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "LOG_RECORD" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20),
  "TIMESTAMP" timestamp NOT NULL,
  "AUDITTYPE" varchar(255),
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "PROJECT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "CODE" varchar(100) NOT NULL,
  "PROJECT_DESCRIPTION" varchar(200) NOT NULL,
  "ACTIVITY_DESCRIPTION" varchar(200),
  "CUSTOMER_ID" numeric(20) NOT NULL,
  "START_DATE" date NOT NULL,
  "END_DATE" date,
  "RATE" decimal(50,2) NOT NULL,
  "VATTYPE" integer,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "RESTWAARDE" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "ACTIVA_ID" numeric(20) NOT NULL,
  "RESTWAARDE" decimal(50,0) NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "SETTLEMENT" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "DESCRIPTION" varchar(65535) NOT NULL,
  "STARTDATE" date NOT NULL,
  "PURCHASEPRICE" integer NOT NULL,
  "STARTUPCOSTS" decimal(10,2),
  "NOFSQUAREMETERSBUSINESS" integer NOT NULL,
  "NOFSQUAREMETERSPRIVATE" integer,
  "WOZVALUE" integer NOT NULL,
  "TERRAINVALUE" integer,
  "NOFYEARSFORDEPRECIATION" integer NOT NULL,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "SPLITMATCH_PRIVATE" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "KOSTMATCH_ID" numeric(20) NOT NULL,
  "PERCENTAGE" integer,
  PRIMARY KEY ("ID")
);
CREATE TABLE IF NOT EXISTS "USER" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USERNAME" varchar(50) NOT NULL,
  "ROLE" varchar(20) NOT NULL,
  "PASSWORD" varchar(50) NOT NULL,
  "INITIALS" varchar(10) NOT NULL,
  "PREFIX" varchar(10),
  "SURNAME" varchar(100) NOT NULL,
  "PHONENUMBER" varchar(20),
  "FISCALNUMBER" varchar(20),
  "VATPERIODTYPE" integer,
  "EMAIL" varchar(50) NOT NULL,
  "REMARKS" varchar(255),
  "REGISTRATIONDATE" date NOT NULL,
  "KVK_NUMMER" numeric(20),
  "COMPANYNAME" varchar(100) NOT NULL,
  "COMPANY_ADDRESS" varchar(200) NOT NULL,
  "COMPANY_ZIPCODE" varchar(10) NOT NULL,
  "COMPANY_CITY" varchar(50) NOT NULL,
  "ACCOUNTNUMBER" varchar(20) NOT NULL,
  "LATESTONLINETIME" datetime,
  "BLOCKED" integer,
  "FREEZESTARTDATE" date,
  "FREEZEENDDATE" date,
  "DEFROSTREQUESTDATE" date,
  "PAID" integer,
  "ACTIVATION_CODE" varchar(36),
  PRIMARY KEY ("ID")
);CREATE TABLE IF NOT EXISTS "VAT_DECLARATION" (
  "ID" numeric(20) NOT NULL AUTO_INCREMENT,
  "USER_ID" numeric(20) NOT NULL,
  "DECLARATION_NUMBER" varchar(40),
  "PAYMENT_FEATURE" varchar(16),
  "DECLARATION_FEATURE" varchar(40),
  "TIMESTAMP_DECLARED" timestamp NULL,
  "TIMESTAMP_PAID" timestamp NULL,
  PRIMARY KEY ("ID")
);


















